s.aL(0,"Scale Effect",new A.aYU(),"https://github.com/flame-engine/flame/blob/main/examples/lib/stories/effects/scale_effect_example.dart","    In this example you can tap the screen and the component will scale up or\n    down, depending on its current state.\n    \n    The star pulsates randomly using a RandomEffectController.\n  ")
s.aL(0,"Opacity Effect",new A.aYV(),"https://github.com/flame-engine/flame/blob/main/examples/lib/stories/effects/opacity_effect_example.dart","    In this example we show how the `OpacityEffect` can be used in two ways.\n    The left Ember will constantly pulse in and out of opacity and the right\n    flame will change opacity when you click the screen.\n  ")
